h the Loop Builder, you gain more creative freedom to design your posts and listings, so you can design it any way you’d like.\";s:7:\"created\";i:1667397460;s:5:\"badge\";s:3:\"New\";s:3:\"url\";s:128:\"https://elementor.com/blog/introducing-the-loop-builder/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}','no'),(460,'action_scheduler_migration_status','complete','yes'),(466,'_transient_timeout_kirki_remote_url_contents','1676998183','no'),(467,'_transient_kirki_remote_url_contents','a:3:{s:32:\"9b28d47e100359af6d44e609f53b5875\";s:6054:\"/* cyrillic-ext */\n@font-face {\n  font-family: \'Open Sans\';\n  font-style: normal;\n  font-weight: 500;\n  font-stretch: normal;\n  font-display: swap;\n  src: url(https://fonts.gstatic.com/s/opensans/v34/memSYaGs126MiZpBA-UvWbX2vVnXBbObj2OVZyOOSr4dVJWUgsjr0B4taVQUwaEQXjN_mQ.woff) format(\'woff\');\n  unicode-range: U+0460-052F, U+1C80-1C88, U+20B4, U+2DE0-2DFF, U+A640-A69F, U+FE2E-FE2F;\n}\n/* cyrillic */\n@font-face {\n  font-family: \'Open Sans\';\n  font-style: normal;\n  font-weight: 500;\n  font-stretch: normal;\n  font-display: swap;\n  src: url(https://fonts.gstatic.com/s/opensans/v34/memSYaGs126MiZpBA-UvWbX2vVnXBbObj2OVZyOOSr4dVJWUgsjr0B4kaVQUwaEQXjN_mQ.woff) format(\'woff\');\n  unicode-range: U+0301, U+0400-045F, U+0490-0491, U+04B0-04B1, U+2116;\n}\n/* greek-ext */\n@font-face {\n  font-family: \'Open Sans\';\n  font-style: normal;\n  font-weight: 500;\n  font-stretch: normal;\n  font-display: swap;\n  src: url(https://fonts.gstatic.com/s/opensans/v34/memSYaGs126MiZpBA-UvWbX2vVnXBbObj2OVZyOOSr4dVJWUgsjr0B4saVQUwaEQXjN_mQ.woff) format(\'woff\');\n  unicode-range: U+1F00-1FFF;\n}\n/* greek */\n@font-face {\n  font-family: \'Open Sans\';\n  font-style: normal;\n  font-weight: 500;\n  font-stretch: normal;\n  font-display: swap;\n  src: url(https://fonts.gstatic.com/s/opensans/v34/memSYaGs126MiZpBA-UvWbX2vVnXBbObj2OVZyOOSr4dVJWUgsjr0B4jaVQUwaEQXjN_mQ.woff) format(\'woff\');\n  unicode-rang